import {React} from 'react';
import './MenuTop.scss';
import LogoPag from '../../../assets/images/png/logo-white.png';

export default function MenuTop(){
    return (
        <div className='menu-top'>
            <div className='menu-top__left'>
                <img
                    className='menu-top_logo'
                    src={LogoPag}
                    alt='Logo Turnalia'
                />
            </div>
        </div>
    );
}
